import "./Services.css"
import TopNav from "../../TopNav/TopNav"
import FooterBar from "../../FooterBar/FooterBar"

export default function Services() {
    return (
        <div className="servicescont">
            <TopNav />
            <div className="services"></div>
            <FooterBar />
        </div>
    )
}
